var tipuesearch = {"pages": [{'title': 'NFU', 'text': 'https://nfu.edu.tw/ \n \n', 'tags': '', 'url': 'NFU.html'}, {'title': 'Replit', 'text': 'https://replit.com/~ \n \n \n \n \n', 'tags': '', 'url': 'Replit.html'}, {'title': '英文相關檢定', 'text': '', 'tags': '', 'url': '英文相關檢定.html'}, {'title': '托福', 'text': '托福紙筆測驗(TOEFL ITP®)是用紙、筆填寫答案卡方式，以選擇題方式測驗考生的聽力、文法結構與閱讀能力三大項目，目前不考口說與寫作。測驗對象是國際交換學生、條件式入學學生、語言學校、中等學校與成人學校的學生及大學國際化教育計劃的學生，而TOEFL ITP的成績也常做為社區學院與獎助計劃申請者之報名條件。完整測驗時間為115分鐘，測驗費用為新台幣1,200元。 \n 托福網路測驗(TOEFL iBT®)是現階段北美洲大學入學許可之認證考試，由原先之TOEFL CBT電腦型態測驗於2006年9月停辦後，所改制而成。托福網路測驗(TOEFL iBT®)是使用電腦與耳機麥克風，透過網路即時連線至ETS進行線上測驗，考試範圍涵蓋「聽、說、讀、寫」四項技能，並採取整合技能(Integrated Skills)方試測驗，完整測驗時間為3小時 ，測驗費用為美金235元（約新台幣6,900元）。 \n', 'tags': '', 'url': '托福.html'}, {'title': '多益', 'text': '多益 ，直譯為 國際交流用英語測試 （Test of English for International Communication, TOEIC），是 ETS 的一項付費考試服務，和 托福 的考試主要對象不同，主要是針對在英語社會求職之需要。考試的形式有所不同：「多益」的聽力與閱讀考試由兩個等分值的部分組成，總分最高為990分。「新多益」的口語與寫作考試則由發音、詞彙、語法、流暢、整體連貫度、結構（句子組織）組成，總分最高為400分。 \n', 'tags': '', 'url': '多益.html'}, {'title': 'GRE', 'text': '研究生入學考試 （英語： Graduate Record Examinations，GRE ），是由私立的 美國教育考試服務中心 （ ETS ）主辦的標準化 考試 ，用來測驗大學畢業生的知識技能掌握情況。在很多英語國家特別是 美國 ，GRE成績被作為 研究生 錄取的標準之一。如今在歐洲，亞太地區也有越來越多的大學，如德國，香港，新加坡的大學，把GRE作為英語授課課程錄取標準之一。1949年，ETS創辦、並執行考試任務，旨在檢測學生在長時間學習過程中積累的詞彙、數量分析、分析性寫作、批判性思維，但並不特定某一專業領域。GRE考試由合格的測試中心主持提供機考。 \n', 'tags': '', 'url': 'GRE.html'}, {'title': 'About', 'text': 'https://github.com/51133131/51133131.github.io \n https://51133131.github.io \n https://github.com/mdecycu/cmside \n \n \n \n \n', 'tags': '', 'url': 'About.html'}]};